import Message from "./Message"
import React, { useState, useEffect } from "react"
import "./Center.css"
import Request from "./Request/index.jsx"
import CenterForm from "./CenterForm/"
import EmptyThreadInfoBox from "./EmptyThreadInfoBox"

function Center(props) {
	const [delilahWorking, setDelilahWorking] = useState(false)

	useEffect(() => {
		setFormData({
			...formData,
			thread_id: props.selectedThread,
		})
	}, [props.selectedThread])

	// Prompt Form
	const choiceTypes = ["prompt", "subject", "demographics"]

	const [formData, setFormData] = useState({
		prompt_type: "brainstorm",
		prompt_choices: [
			{ choice_type: choiceTypes[0], choice: "" },
			{ choice_type: choiceTypes[1], choice: "" },
			{ choice_type: choiceTypes[2], choice: "" },
		],
		thread_id: props.selectedThread,
	})

	const handleChangeForm = (event, index) => {
		const { name, value } = event.target
		const newPromptChoices = [...formData.prompt_choices]

		if (event.target.name === "prompt_type")
			setFormData({
				...formData,
				[event.target.name]: event.target.value,
			})
		else newPromptChoices[index][name] = value
		setFormData({
			...formData,
			prompt_type: name === "prompt_type" ? value : formData.prompt_type,
			prompt_choices: newPromptChoices,
		})
	}

	const sendForm = () => {
		setDelilahWorking(true)

		const parameters = {
			data: formData,
			method: "POST",
		}

		const generationsRequest = new Request("generations/", parameters)
		generationsRequest
			.then((res) => {
				props.setTokensUsed(props.tokensUsed + res.data.tokens_used)

				props.setThreads(
					props.threads.map((thread) => {
						if (thread.id === props.selectedThread) {
							return {
								...thread,
								generations: [...thread.generations, res.data],
							}
						}
						return thread
					})
				)

				setFormData({
					...formData,
					prompt_type: "brainstorm",
					prompt_choices: [
						{ choice_type: choiceTypes[0], choice: "" },
						{ choice_type: choiceTypes[1], choice: "" },
					],
				})
				setDelilahWorking(false)
			})
			.catch((err) => {
				console.log(err)
				setDelilahWorking(false)
			})
	}

	// Update Form / Quicktools
	const [command, setCommand] = useState("general")
	const [showTextField, setShowTextField] = useState(true)
	const [textFieldValue, setTextFieldValue] = useState("")

	const handleChange = (e) => {
		setCommand(e.target.value)
		setShowTextField(e.target.value !== "")
	}

	const sendCommands = (e, valCommand, valTextFieldValue) => {
		e.preventDefault()
		console.log(valCommand, valTextFieldValue)
		setDelilahWorking(true)

		const parameters = {
			data: {
				command: valCommand,
				text_field_value: valTextFieldValue,
				thread_id: props.selectedThread,
			},
			method: "POST",
		}

		const commandsRequest = new Request("generations/", parameters)
		commandsRequest
			.then((res) => {
				props.setTokensUsed(props.tokensUsed + res.data.tokens_used)

				props.setThreads(
					props.threads.map((thread) => {
						if (thread.id === props.selectedThread) {
							return {
								...thread,
								generations: [...thread.generations, res.data],
							}
						}
						return thread
					})
				)

				setCommand("general")
				setTextFieldValue("")
				setDelilahWorking(false)
			})
			.catch((err) => {
				console.log(err)
				setDelilahWorking(false)
			})
	}

	// delete the most recent generation from the thread
	const deleteGeneration = (e) => {
		setDelilahWorking(true)

		const commandsRequest = new Request(
			"threads/" + props.selectedThread + "/delete_last_generation/",
			{
				method: "POST",
			}
		)

		commandsRequest
			.then((response) => {
				props.setThreads(
					props.threads.map((thread) => {
						if (thread.id === props.selectedThread) {
							return {
								...thread,
								generations: thread.generations.slice(
									0,
									thread.generations.length - 1
								),
							}
						}
						return thread
					})
				)
				setDelilahWorking(false)
			})
			.catch((err) => {
				console.log(err)
				setDelilahWorking(false)
			})
	}

	// regenerate the last geneartion
	const regenerateGeneration = (e) => {
		setDelilahWorking(true)
		const commandsRequest = new Request(
			"threads/" + props.selectedThread + "/regenerate/",
			{
				method: "POST",
			}
		)

		commandsRequest
			.then((response) => {
				props.setThreads(
					props.threads.map((thread) => {
						if (thread.id === props.selectedThread) {
							return {
								...thread,
								generations: [
									...thread.generations.slice(
										0,
										thread.generations.length - 1
									),
									response.data,
								],
							}
						}
						return thread
					})
				)
				setDelilahWorking(false)
			})
			.catch((err) => {
				console.log(err)
				setDelilahWorking(false)
			})
	}

	return (
		<div className="center bg-black">
			<div className="generations-chat bg-slate-100">
				{props.threads.find(
					(thread) => thread.id === props.selectedThread
				).generations.length === 0 ? (
					<div className="flex flex-col items-center justify-center h-full">
						<h1 className="text-4xl font-semibold text-center mt-6 sm:mt-[20vh] ml-auto mr-auto mb-10 sm:mb-16 flex gap-2 items-center justify-center">
							Delilah
						</h1>
						<div className="md:flex items-start text-center gap-3.5">
							<EmptyThreadInfoBox
								title="Examples"
								text1="A Vietnamese son of immigrants who grew up in mom's restaurant."
								text2="A teen who grew up in a rural town in the middle of nowhere."
								text3="A teen who grew up in a crime-ridden city."
								clickable={true}
							></EmptyThreadInfoBox>
							<EmptyThreadInfoBox
								title="Capabilities"
								text1="PENIS FUCK SHIT"
								text2="PENIS FUCK SHIT"
								text3="PENIS FUCK SHIT"
								clickable={false}
							></EmptyThreadInfoBox>
							<EmptyThreadInfoBox
								title="Limitations"
								text1="Requires you to input specific and personal experiences"
								text2="Limited knowledge of the world and events after 2021"
								text3="May occasionally produce harmful instructions or biased content"
								clickable={false}
							></EmptyThreadInfoBox>
						</div>
					</div>
				) : (
					<div>
						{props.threads
							.find(
								(thread) => thread.id === props.selectedThread
							)
							.generations.map((generation, index, arr) => {
								const isLast = index === arr.length - 1
								return (
									<>
										<Message
											key={index}
											text={generation.prompt.user_string}
											author="You"
											sendCommands={sendCommands}
											delilahWorking={delilahWorking}
											setDelilahWorking={
												setDelilahWorking
											}
											snippets={props.snippets}
											setSnippets={props.setSnippets}
											isLast={isLast}
										/>
										<Message
											key={index + 1}
											text={generation.text}
											author="Delilah"
											sendCommands={sendCommands}
											delilahWorking={delilahWorking}
											setDelilahWorking={
												setDelilahWorking
											}
											snippets={props.snippets}
											setSnippets={props.setSnippets}
											isLast={isLast}
										/>
									</>
								)
							})}
						<div
							ref={(el) => {
								if (el) {
									el.scrollIntoView(false)
								}
							}}
						/>
					</div>
				)}
			</div>

			<CenterForm
				threads={props.threads}
				selectedThread={props.selectedThread}
				formData={formData}
				handleChangeForm={handleChangeForm}
				command={command}
				sendForm={sendForm}
				handleChange={handleChange}
				showTextField={showTextField}
				textFieldValue={textFieldValue}
				setTextFieldValue={setTextFieldValue}
				sendCommands={sendCommands}
				deleteGeneration={deleteGeneration}
				regenerateGeneration={regenerateGeneration}
				delilahWorking={delilahWorking}
			/>
		</div>
	)
}

export default Center
